text:
@grubbypandas Great point and great question. 

Do you mean like “questions to ask myself as I prepare a lesson?”

Also, we believe that high quality curriculum should be provided to educators to help them with the anticipating stage. It shouldn’t be from scratch...

@SkipFennell @lehmaniler @MrOrr_geek @MathletePearce @WhitneyBecker23 @Dr_Beyranevand @d_martin05 @JohnSanGiovanni @iteachthewhy @pwharris Love your time context approach!

Interestingly enough, your time approach is partitive in nature (i.e.: dividing into 4 parts) while your "conventional" approach is more quotative in nature (i.e.: dividing into groups of 4). 

Love em!

We're having an internal competition,but I thought it would be interesting to see what the math community's vote for best would be. If you're interested in seeing more of their work, and voting if you'd like, check them out here https://t.co/d6p6YGPULj 
